import React from "react";

export default function Header() {
  return (
    <header>
      <nav className="nav">
        <div className="logo">
          <img className="nav-logo" src="./react-logo.png" alt="react-logo" />
          <h2>love React</h2>
        </div>
        <ul className="nav-items">
          <li>Pricing</li>
          <li>About</li>
          <li>Contact</li>
        </ul>
      </nav>
    </header>
  );
}
